import React, { useState } from 'react'

function Movement() {

    //const [Movement,setMovement] = useState("Stop");


    return (
        window.addEventListener('keydown', (event) => {
            switch (event.key){
                case 'ArrowUp': break;
                case 'ArrowDown': break;
                case 'ArrowLeft': break;
                case 'ArrowRight': break;
            }
        })
    )
}

export default Movement
